import React from "react";
import { Link } from 'react-router-dom'
import * as SUtils from '../Helpers/SUtils'

const styles = {
    root: {
        position: 'relative',
        width: '100%',
        overflow: 'hidden',
    },
    swiper: {
        height: '7em',
        overflow: 'hidden',
        width: '95%',
        marginLeft: '5%',
    },
    slideSwiper: {
        display: 'block',
        paddingRight: '0.5em',
        float: 'left',
        margin: '0 5% 0 0',
        width: '20%',
        transition: '.5s',
    },
    next: {
        position: 'relative',
        top: 0,
        right: 0,
        left: 0,
        bottom: 0,
        height: '100%',
        width: '100%',
    },
    link: {
        position: 'absolute',
        top: 0,
        right: 0,
        height: '6em',
        width: '7em',
        textAlign: 'center',
        background: 'url("data:image/png;base64,") no-repeat 50% 50%',
        backgroundSize: 'contain',
    },
    magSwiper: {
        width: '100%',
    },
    active: {
        opacity: .8,
        paddingTop: '1em',
    },
};

class SwiperTop extends React.Component {
    constructor(props) {
        super(props);
    }

    getAllIssuesLink = () => {
        let id = 0;
        if(this.props.parent_type === 'bundle')
            id = this.props.bundle_id;
        else
            id = SUtils.first(this.props.issues).journal_id;

        return `/all_issues/${this.props.parent_type}/${id}`;
    };

    render() {
        const { active } = this.props;

        return (
            <div style={styles.root}>
                <div style={styles.swiper}>
                    {this.props.issues.map((issue, i) => {
                        let show;
                        if (i === active)
                            show = Object.assign({}, styles.slideSwiper, styles.active);
                        else
                            show = styles.slideSwiper;
                        return  <Link to={`/issue/${issue.id}`} key={issue.id} style={show}>
                                    <img style={styles.magSwiper} src={issue.image_path} alt={issue.title}/>
                                </Link>
                        }
                    )}
                </div>
                <div>
                    <Link to={this.getAllIssuesLink()} style={styles.link} />
                </div>
            </div>
        );
    }
}

export default SwiperTop;